window.bookSummaryJSON = "<p>Dominic Prado is a professional hitman and fixer for his werewolf pack. It's a tough job, but it keeps his mind off a past he'd rather forget. He prefers solitude, but his commitment to going through life alone is upended when he's sent to New Orleans to hunt down a murderer.</p> <p>There, he meets Lily Agincourt, a latent werewolf on the run from accusations of murder. Lily challenges him with her fiery beauty and claims of innocence. As their attraction grows, Dom must decide between following orders and taking Lily's life, or helping her prove she isn't the killer. But the past isn't done with either of them, and their fight for a future together may end up being a fight for their lives.</p> <p>Contains mature themes.</p>"; 
